## Determining the Skew 

##Skew function is defined as the difference in the total number occurrences of G and C
## in the first i nucleotides of Genome.

def FindSkew(String):
	Skew=[];Skew.append(0);i=1;j=0
	while j < len(String):
		if String[j]=="C":
			Skew.append(Skew[i-1]-1)
		elif String[j]=="G":
			Skew.append(Skew[i-1]+1)
		else:
			Skew.append(Skew[i-1])
		i+=1
		j+=1
	return Skew

def MinSkew(String):
	Skew=FindSkew(String)
	index=[]
	mini=min(Skew)
	i=0
	while i<len(Skew):
		if Skew[i]==mini:
			index.append(i)
		i+=1
	return index


